import React from 'react'
import Footer from '../footer'
import Header from '../Header'
import './blog.css'
import Pagination from '@material-ui/lab/Pagination';
import BlogSingle from './Blogsingle'
import BlogComponent from './BlogComponent';
import {
    BrowserRouter as Router , Route, Switch,useParams
} from 'react-router-dom'
import BlogSearchBox from './BlogSearchBox';
import { AddRounded } from '@material-ui/icons';
import Blogsingle from './Blogsingle';
const Blog = () => {
     let {slug} = useParams;
     

   const address = window.location.href;
   console.log(address);

    return (
        <div>
       
        
            <Header listing background="white" color="gray" border="1px solid lightgray" />
            <div className="blogpage">
                <div className="blogpage_head">Blog</div>
                <div className="blogpage_body">
                    <div className="blogpage_bodyblog">
                       <BlogComponent auther='dev' date="December 20, 2020" description="orem Ipsum is simply dummy text of the printing and typesetting industry. , when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. " title='1Title here somehting more'/>
                       <BlogComponent title='2Title here somehting more'/>
                       <BlogComponent title='3Title here somehting more'/>
                       <BlogComponent title='4Title here somehting more'/>
                       <BlogComponent title='5Title here somehting more'/>
                       <BlogComponent title='6Title here somehting more'/>
                       
                  
                    </div>
                   <BlogSearchBox search category tag topblog/>
                </div>
                <div className="pagination">
                    <Pagination count={10} color="secondary" />
                </div>
            </div>


            <Footer />
        </div>
    )
}

export default Blog
